  //{{{  areWeOutOfTime
  
  cwtchStruct.prototype.areWeOutOfTime = function () {
  
    return (this.bestMove && this.finishTime && Date.now() > this.finishTime) ||
           (this.targetNodes && this.nodeCount >= this.targetNodes);
  
  }
  
