  //{{{  fen
  
  cwtchStruct.prototype.fen = function (ply) {
  
    let fen = '';
    let n   = 0;
  
    for (let i=0; i < 8; i++) {
      for (let j=0; j < 8; j++) {
        const sq  = B88[i*8 + j]
        const obj = this.board[sq];
        if (obj == 0)
          n++;
        else {
          if (n) {
            fen += '' + n;
            n = 0;
          }
          fen += OBJ_CHAR[obj];
        }
      }
      if (n) {
        fen += '' + n;
        n = 0;
      }
      if (i < 7)
        fen += '/';
    }
  
    if (this.turn == WHITE)
      fen += ' w';
    else
      fen += ' b';
  
    if (this.rights) {
      fen += ' ';
      if (this.rights & WHITE_RIGHTS_KING)
        fen += 'K';
      if (this.rights & WHITE_RIGHTS_QUEEN)
        fen += 'Q';
      if (this.rights & BLACK_RIGHTS_KING)
        fen += 'k';
      if (this.rights & BLACK_RIGHTS_QUEEN)
        fen += 'Q';
    }
    else
      fen += ' -';
  
    if (this.ep)
      fen += ' ' + COORDS[this.ep];
    else
      fen += ' -';
  
    fen += ' 0 ' + ply;
  
    return fen;
  }
  
  //}}}
  //{{{  isKingAttacked
  
  cwtchStruct.prototype.isKingAttacked = function (to, byCol) {
  
    const b = this.board;
  
    const cx = colourIndex(byCol);
  
    const OFFSET_DIAG1 = -WB_OFFSET_DIAG1[cx];
    const OFFSET_DIAG2 = -WB_OFFSET_DIAG2[cx];
    const RQ           = WB_RQ[cx];
    const BQ           = WB_BQ[cx];
    const BY_PAWN      = WB_PAWN[cx];
    const N            = KNIGHT | byCol;
  
    let fr = 0;
  
    //{{{  pawns
    
    if (b[to+OFFSET_DIAG1] == BY_PAWN || b[to+OFFSET_DIAG2] == BY_PAWN)
      return 1;
    
    //}}}
    //{{{  knights
    
    if ((b[to + -10] == N) ||
        (b[to + -23] == N) ||
        (b[to + -14] == N) ||
        (b[to + -25] == N) ||
        (b[to +  10] == N) ||
        (b[to +  23] == N) ||
        (b[to +  14] == N) ||
        (b[to +  25] == N)) return 1;
    
    //}}}
    //{{{  queen, bishop, rook
    
    fr = to + 1;  while (!b[fr]) fr += 1;  if (RQ[b[fr]]) return 1;
    fr = to - 1;  while (!b[fr]) fr -= 1;  if (RQ[b[fr]]) return 1;
    fr = to + 12; while (!b[fr]) fr += 12; if (RQ[b[fr]]) return 1;
    fr = to - 12; while (!b[fr]) fr -= 12; if (RQ[b[fr]]) return 1;
    
    fr = to + 11; while (!b[fr]) fr += 11; if (BQ[b[fr]]) return 1;
    fr = to - 11; while (!b[fr]) fr -= 11; if (BQ[b[fr]]) return 1;
    fr = to + 13; while (!b[fr]) fr += 13; if (BQ[b[fr]]) return 1;
    fr = to - 13; while (!b[fr]) fr -= 13; if (BQ[b[fr]]) return 1;
    
    //}}}
  
    return 0;
  }
  
  //}}}
  //{{{  isDraw
  
  cwtchStruct.prototype.isDraw = function () {
  
    if (this.hHistoryNext - this.hHistoryLimit > 100)
      return true;
  
    if (this.wList[LCOUNT] == 1 && this.bList[LCOUNT] == 1)
      return true;
  
    if (this.wList[LCOUNT] == 1 && this.bList[LCOUNT] == 2 && this.board[this.bList[2]] == KNIGHT|BLACK)
      return true;
  
    if (this.wList[LCOUNT] == 1 && this.bList[LCOUNT] == 2 && this.board[this.bList[2]] == BISHOP|BLACK)
      return true;
  
    if (this.bList[LCOUNT] == 1 && this.wList[LCOUNT] == 2 && this.board[this.wList[2]] == KNIGHT|WHITE)
      return true;
  
    if (this.bList[LCOUNT] == 1 && this.wList[LCOUNT] == 2 && this.board[this.wList[2]] == BISHOP|WHITE)
      return true;
  
    let count = 0;
  
    for (let i=this.hHistoryNext-5; i >= this.hHistoryLimit; i -= 2) {
  
      if (this.hashEq(this.hHistoryLo[i],this.hHistoryHi[i])) {
        count++;
        if (count == 2) {
          return true;
        }
      }
    }
  
    return false;
  }
  
